    imports: [TwentyOnePointsSharedLibsModule],
    declarations: [JhiAlertComponent, JhiAlertErrorComponent],
    exports: [TwentyOnePointsSharedLibsModule, JhiAlertComponent, JhiAlertErrorComponent]
